import React from "react";
import { Link } from 'react-router-dom'
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles"; 
import Fab from '@material-ui/core/Fab';
import Button from "@material-ui/core/Button";
import "./Navbar.css"; 
const styles = {
  root: {
    flexGrow: 1
  },
  button: { 
    color: "#d6d7da",
    fontSize: 18,
    alignItems: "center", 
    height: 50,
    fontFamily: "'Montserrat', sans-serif",
  },
  tit: {
    textDecoration: "none",

  },
  link: {
      color: "white",
      textDecoration: "none"
  },
  fab: {
    backgroundColor: "#6a3499",
    fontSize: 18,
    alignItems: "center", 

    fontFamily: "'Montserrat', sans-serif",
  }

};

function NavbarPage(props) {
  const { classes } = props;

  return (
    <nav id="menu" className="menu " className="appbar" > 
     <button className="but-title"> <Link to="/" className={classes.tit}><h3 className="title">Kroz objektiv</h3></Link></button>
     <Button variant="outlined" className={classes.button}>Quiz</Button>
     <Button variant="outlined" className={classes.button}><Link to="/create" className={classes.link}>Kreiraj post</Link></Button>
     <Fab color="primary" aria-label="Add" className={classes.fab}>
        NN
      </Fab>
    </nav>
  );
}

NavbarPage.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(NavbarPage);
